tables.table_schema:
CREATE TABLE patient_data (
  patient_id INT PRIMARY KEY,
  age INT,
  gender VARCHAR(10),
  location VARCHAR(50)
);

CREATE TABLE public_health_strategies (
  strategy_id INT PRIMARY KEY,
  strategy_name VARCHAR(50),
  target_population VARCHAR(100),
  implementation_date DATE
);

CREATE TABLE public_health_data (
  data_id INT PRIMARY KEY,
  recorded_date DATE,
  population_density INT,
  disease_prevalence DOUBLE PRECISION
);
